# OEIS sequence: A352635

def o(n):
    orbits = set()
    for k in range(n):
        x, traj = k, []
        while x not in traj:
            traj.append(x)
            x = (x**2 + 1) % n
        orbits.add(tuple(sorted(traj[traj.index(x):])))
    return orbits
